const Header = () => {
  return (
    <div className="header">
      <img
        className="logo"
        alt="App logo"
        src="https://media.istockphoto.com/id/1190040680/vector/plastic-bag-food-delivery-icon.jpg?s=612x612&w=0&k=20&c=rH4wx01088_bKVXSppri6XSj54ovSZDiW4fe5YhHJE8="
      />
      <div className="header-categories">
        <ul>
          <li>Search</li>
          <li>Offers</li>
          <li>Help</li>
          <li>Profile</li>
          <li>Cart</li>
        </ul>
      </div>
    </div>
  );
};

const RestaurantCard = (props) => {
  const { resData } = props;
  const {
    name,
    cloudinaryImageId,
    cuisines,
    avgRatingString,
    sla,
    costForTwo,
    aggregatedDiscountInfoV2,
    aggregatedDiscountInfoV3,
  } = resData?.info;

  return (
    <div className="res-card" style={{ backgroundColor: "#ffffff" }}>
      <img
        className="res-logo"
        src={
          "https://res.cloudinary.com/swiggy/image/upload/fl_lossy,f_auto,q_auto,w_508,h_320,c_fill/" +
          cloudinaryImageId
        }
      />

      <h4 className="res-name">{name}</h4>
      <h5 className="res-cuisines">{cuisines.join(", ")}</h5>
      <div className="res-about">
        <h6 className="res-rating">
          <i className="fa-sharp fa-solid fa-star"></i> {avgRatingString}
        </h6>
        <div>•</div>
        <h6 className="res-delTime">{sla.deliveryTime} MINS</h6>
        <div>•</div>
        <h6 className="res-delTime">{costForTwo}</h6>
      </div>

      <h4 className="res-discount">
        {aggregatedDiscountInfoV2 && aggregatedDiscountInfoV2.descriptionList
          ? aggregatedDiscountInfoV2.descriptionList[0]
            ? aggregatedDiscountInfoV2.descriptionList[0].meta
            : ""
          : ""}
      </h4>
    </div>
  );
};

const Boby = () => {
  return (
    <div className="body">
      <div className="search-section">
        <input className="search-bar" placeholder="search food"></input>
        <button className="search-btn">search</button>
      </div>
      <div className="res-container">
        {resList.map((restaurent) => (
          <RestaurantCard key={restaurent.info.id} resData={restaurent} />
        ))}
      </div>
    </div>
  );
};

const App = () => {
  return (
    <>
      <Header />
      <Boby />
    </>
  );
};

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<App />);
